import React from "react";

function ResultList(props) {
  return (
    <ul className="list-group">
      {props.result.items.map(results => (
        <li className="list-group-item" key={results.id}>
          <h3>{results.title}</h3>
        </li>
      ))}
    </ul>
  );
}

export default ResultList;
